import React, { Component } from 'react';
import Home from '../pages/Home';
import '../css/app.css'


export default class Layout extends Component {

    constructor(props) {
        super(props)
    }
    

    render() {
        return (
            <div className="app-layout">
                    <Home />
            </div>
        )
    }
}
